import Nav from 'react-bootstrap/Nav';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Contact.css'
function Contact() {
  return (
    <>
      <Nav justify variant="tabs" activeKey="3">
        <Nav.Item>
          <Nav.Link href="/photo" eventKey="1">Photography</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link href="/film" eventKey="2">Film</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link href="/contact" eventKey="3">Contact</Nav.Link>
        </Nav.Item>
      </Nav>
    </>
  );
}
export default Contact;
